import requests
import bs4

cat = []


def check_sub_cat(context):
    req = requests.get(url=context['url'], headers={'User-Agent': 'Mozilla/5.0'}).text
    html = bs4.BeautifulSoup(req, 'html.parser')
    cont = html.findAll('div', class_='catalog__category')
    for i in cont:
        for j in i.findAll('a', class_='category__item'):
            title = j.find('h3', class_='category__item-title').text
            sub_context = {
                'title': title,
                'url': j['href'],
                'parent_id': context['title'],
            }
            cat.append(sub_context)
            print(f'{len(cat)}')
            check_sub_cat(sub_context)


def main():
    URL = 'https://navsl.ru/katalog/'
    req = requests.get(url=URL, headers={'User-Agent': 'Mozilla/5.0'}).text
    html = bs4.BeautifulSoup(req, 'html.parser')
    cont = html.findAll('div', class_='catalog__category')
    for i in cont:
        for j in i.findAll('a', class_='category__item'):
            title = j.find('h3', class_='category__item-title').text
            context = {
                'title': title,
                'url': j['href'],
                'parent_id': '',
            }
            cat.append(context)
            print(f'{len(cat)}')
            check_sub_cat(context)
    print(len(cat))
    # category = list(set(cat))
    # print(len(category))
    print(cat)


if __name__ == '__main__':
    main()


